import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';
import { Link } from 'react-router-dom';

const NavBlock = styled.div`
position: fixed;
height: 100%;  
width: 12rem;
background: green;
box-shadow: 0px 4px 2px rgba(0, 0, 0, 0.08);


`;
const Wrapper = styled(Responsive)`
  height: 90%;  
  width: 100%;
  background: red;
  display: flex;
  align-items: space-between;
  justify-content: center;
  z-index: 5;

 
`;
const MenuInfo = styled.ul`
background:green;
font-weight: 800;
list-style:none;
width:100%;
`
const Menu = styled.li`
font-size: 1.5rem;
width:100%;
&:hover{
  background:white;
}
`
const Spacer = styled.nav`


`;

const Nav = () => {
    return (
        <>
        <NavBlock>
            <Wrapper>
              <MenuInfo>
              <Menu>게시판</Menu>
              <Menu>모임</Menu>
              <Menu>미션&amp;식물</Menu>
              <Menu>메뉴</Menu>
              </MenuInfo>
              
          
            </Wrapper>
        </NavBlock>
        <Spacer/>
        
        </>
    );
};

export default Nav;
